import axios from 'axios'

export const FETCH_POSTS = 'fetch_posts'
export const GET_POSTS = 'get_posts'

const API_URL = 'http://localhost:8000'

export function fetchposts (link) {
  if (link) {
  	console.log('True')
  }
  const request = axios.get(`${API_URL}/api/posts`)
  console.log(request)
  return {
    type: FETCH_POSTS,
    payload: request
  }
}

export function getCustomersByUrl (link) {
  const request = axios.get(`${link}`)
  console.log(request)
  return {
    type: GET_POSTS,
    payload: request
  }
}
